import React from "react";

function Home() {
  const handleSeoinClick = () => {
    window.location.href = `${process.env.PUBLIC_URL}/seoin/index.html`;
  };

  return (
    <div>
      <h1>Home Page</h1>
      <button onClick={handleSeoinClick}>Seoin Page로 이동</button>
    </div>
  );
}

export default Home;
